from typing import *


import time
from collections import defaultdict
class Solution:
    def hasValidPath(self, grid: List[List[int]]) -> bool:
        start_time = time.time()
        m, n = len(grid), len(grid[0])
        street = {  1:[[0, -1], [0, 1]],
                    2:[[-1, 0], [1, 0]],
                    3:[[0, -1], [1, 0]],
                    4:[[0, 1], [1, 0]],
                    5:[[-1, 0], [0, -1]],
                    6:[[0, 1], [-1, 0]]}
        street_ = {
            (0, -1): {1, 4, 6},
            (0, 1): {1, 3, 5},
            (-1, 0): {2, 3, 4},
            (1, 0):  {2, 5, 6}  
        }
        d = defaultdict(list)
        for i in range(m):
            for j in range(n):
                # print(i, j)
                for ii, jj in street[grid[i][j]]:
                    iii = i+ii
                    jjj = j+jj
                    # print('   ', iii, jjj)
                    if 0 <= iii < m and 0 <= jjj < n:
                        if grid[iii][jjj] in street_[(ii, jj)]:
                            d[(i, j)].append((iii, jjj))

        # print(d)
        print(time.time() - start_time)
        start_time = time.time()

        s = [(0, 0)]
        path = set()
        # print(m-1, n-1)
        while s:
            a = s.pop()
            if a in path:
                continue
            path.add(a)
            if a == (m-1, n-1):
                print(time.time() - start_time)

                return True
            # print(d[a])
            for i in d[a]:
                if i not in path:
                    s.append(i) 
        print(time.time() - start_time)
        
        return False

